import Navigation from "../components/Nav"
import MeditationTabs from "../components/MeditationTabs"

export default function Meditation() {
  return (
    <div>
      <Navigation />

      <div className="meditation-header">
        <h1>Meditation</h1>
        <h3>Unwind with a short session, brought to you by Mr Colonel.</h3>
      </div>

      <MeditationTabs />

      <style jsx>{`

        .meditation-header {
          margin-top: 4vh;
          position: absolute;
          left: 0;
          display: block;
          width: 100vw;
          height: 20vh;
          background: #2978F7;
        }

        h1 {
          font-family: "Raleway", sans-serif;
          font-size: 300%;
        }

        h3 {
          font-family: "Montserrat", sans-serif;
          font-size: 150%;
        }

      `}</style>

    </div>
  );
}
